<script setup>
const defaultArea = ref('#ffffff')
const background = ref('#ffffff')
const clouds = ref('#ffffff')
const cloud2 = ref('#ffffff')
const no_background = ref('#ffffff')
const rainbow_background = ref('#ffffff')
const rainbow2 = ref('#ffffff')
const rainbow3 = ref('#ffffff')
const rainbow4 = ref('#ffffff')
const rainbow5 = ref('#ffffff')
const rainbow6 = ref('#ffffff')
const rainbow7 = ref('#ffffff')
const folder1 = ref('#ffffff')
const folder2 = ref('#ffffff')
const folder3 = ref('#ffffff')
const folder4 = ref('#ffffff')
const folder5 = ref('#ffffff')
const folder6 = ref('#ffffff')
const ok_background = ref('#ffffff')
const no_text = ref('#ffffff')
const ok_text = ref('#ffffff')
const sun = ref('#ffffff')
const sun_top = ref('#ffffff')
const sun_background = ref('#ffffff')
const door_background = ref('#ffffff')
const stairs = ref('#ffffff')
const ball = ref('#ffffff')
const triangle = ref('#ffffff')
const eye = ref('#ffffff')

const colorStore = useColorStore()
const {palette, info, boxColors} = storeToRefs(colorStore)
const filterStore = useFilterStore()
const {preview} = storeToRefs(filterStore)
const { shufflePalette } = colorStore
const changeColors = (colors) => {
  background.value = colors[0]
  clouds.value = colors[1]
  no_background.value = colors[1]
  rainbow2.value = colors[1]
  folder3.value = colors[2]
  rainbow3.value = colors[2]
  ok_background.value = colors[2]
  no_text.value = colors[2]
  rainbow_background.value = colors[3]
  rainbow4.value = colors[3]
  ok_text.value = colors[3]
  rainbow5.value = colors[4]
  folder1.value = colors[4]
  folder4.value = colors[4]
  rainbow6.value = colors[5]
  cloud2.value = colors[5]
  sun_top.value = colors[5]
  folder2.value = colors[6]
  rainbow7.value = colors[6]
  sun_background.value = colors[6]
  door_background.value = colors[7]
  sun.value = colors[7]
  folder5.value = colors[8]
  stairs.value = colors[8]
  folder6.value = colors[9]
  ball.value = colors[9]
  triangle.value = colors[9]
  eye.value = colors[9]

  if (colors.length < 10) {
    folder6.value = colors[1]
    ball.value = colors[1]
    triangle.value = colors[1]
    eye.value = colors[1]
    folder6.value = colors[1]
  }
  if (colors.length < 9) {
    folder5.value = colors[2]
    stairs.value = colors[2]
  }
  if (colors.length < 8) {
    door_background.value = colors[3]
    sun.value = colors[3]
  }
  if (colors.length < 7) {
    folder2.value = colors[4]
    rainbow7.value = defaultArea.value
    sun_background.value = colors[4]
  }
  if (colors.length < 6) {
    rainbow6.value = defaultArea.value
    rainbow7.value = colors[1]
    cloud2.value = colors[1]
    sun_top.value = colors[1]
  }
  if (colors.length < 5) {
    rainbow7.value = colors[2]
    rainbow6.value = colors[1]
    rainbow5.value = defaultArea.value

    folder1.value = colors[2]
    folder2.value = colors[2]
    folder4.value = colors[2]
    sun_background.value = colors[2]
  }
  if (colors.length < 4) {
    rainbow7.value = defaultArea.value
    rainbow6.value = colors[2]
    rainbow5.value = colors[1]
    rainbow4.value = defaultArea.value
    rainbow3.value = colors[2]
    rainbow2.value = colors[1]

    sun.value = colors[1]
    rainbow_background.value = colors[1]
    door_background.value = colors[1]
    ok_text.value = colors[1]
  }
  if (colors.length < 3) {
    ok_background.value = colors[1]
    folder1.value = colors[1]
    folder2.value = colors[1]
    stairs.value = colors[1]
    folder3.value = colors[1]
    folder4.value = colors[1]
    folder5.value = colors[1]
    sun_background.value = colors[1]
    no_text.value = defaultArea.value
    rainbow7.value = defaultArea.value
    rainbow6.value = defaultArea.value
    rainbow5.value = defaultArea.value
    rainbow4.value = defaultArea.value
    rainbow3.value = defaultArea.value
    rainbow2.value = defaultArea.value

  }
}
watch(palette, (palette, oldPalette) => {
    if (palette.colors !== oldPalette?.colors) {
      boxColors.value = palette.colors
    }
  },
  { deep: true }
)
watch(boxColors, (boxColors) => {
    changeColors(boxColors)
  },
)
onMounted(() => {
  if (!palette.value.colors) return
  changeColors(palette.value.colors)
})
</script>

